    "biography": "Diamond-certified American hitmaker Post Malone bridges the gap between the worlds of rap and the pop mainstream. Within five years of his debut, he went from underground genre novelty to certified superstar, amassing a string of Top Ten singles with a hybrid style that combined his unique vocal delivery, pained lyrics, and hip-hop production inspired as much by Tim McGraw as Kanye West. After the release of his 2015 quintuple-platinum single &#34;White Iverson,&#34; off his debut, Stoney, he quickly ascended to the top of the pop mainstream in the late 2010s with a succession of multi-platinum hits that included chart-toppers &#34;Rockstar&#34; with 21 Savage and &#34;Psycho&#34; with Ty Dolla $ign from 2018&#39;s Grammy-nominated Beerbongs &amp; Bentleys and one of the highest-certified singles in RIAA history, &#34;Sunflower&#34; with Swae Lee, from 2019&#39;s pop-leaning Hollywood&#39;s Bleeding. After dialing things back with 2022&#39;s vulnerable Twelve Carat Toothache, he made a further push into guitar-based pop with 2023&#39;s Austin."
