    "biography": "The Weeknd took over pop music &amp; culture on his own terms filtering R&amp;B, Pop,&amp; hip-hop through an ambitious widescreen lens. The multi-platinum 3X GRAMMY Award winner has emerged as one of the most successful &amp; significant artists of the modern era. 2012’s 3X platinum <a href=\"spotify:album:5EbpxRwbbpCJUepbqVTZ1U\" data-name=\"Trilogy\">Trilogy</a> collated 3 breakout mixtapes—House of Balloons, Thursday &amp; Echoes of Silence—into his 1st chart-topping collection followed by his debut LP <a href=\"spotify:album:3hhDpPtCFuQbppwYgsVhMO\" data-name=\"Kiss Land\">Kiss Land</a> in 2013. Two years later, “Earned It (Fifty Shades of Grey)” won “Best R&amp;B Performance” &amp; received an Academy Award nod for “Best Original Song” &amp; 4X Platinum <a href=\"spotify:album:0P3oVJBFOv3TDXlYRhGL7s\" data-name=\"Beauty Behind The Madness\">Beauty Behind The Madness</a> won a GRAMMY for “Best Urban Contemporary Album.” In 2018, <a href=\"spotify:album:2ODvWsOgouMbaA5xf0RkJe\" data-name=\"Starboy\">Starboy</a> won the same award, making him the 1st artist ever to win twice. His 6-track project My Dear Melancholy marked his 3rd consecutive #1 bow on the Billboard Top 200, &amp; “Pray For Me” with Kendrick Lamar &amp; <a href=\"spotify:artist:67Aux8pNOScNMgB0cA2Gwg\" data-name=\"Niels\">Niels</a> was featured in the trailer for the Academy Award winning Marvel film Black Panther. In 2020 the 80’s-nostalgic track <a href=\"spotify:track:0VjIjW4GlUZAMYd2vXMi3b\" data-name=\"Blinding Lights\">Blinding Lights</a> became a worldwide sensation, igniting viral dance challenges across social media, peaking at #1 in 30&#43; countries &amp; headlining Mercedes Benz EQC campaign. <a href=\"spotify:album:4yP0hdKOZPNshxUOjY0cZj\" data-name=\"After Hours\">After Hours</a> held the #1 spot on Billboard 200 for 4 consecutive weeks, marking his 4th #1 album &amp; becoming the first to ever rank #1 on the Billboard 200, Hot 100, and Artist 100 simultaneously. <a href=\"spotify:album:4yP0hdKOZPNshxUOjY0cZj\" data-name=\"After Hours\">After Hours</a> is the #1 R&amp;B streaming album of all time (followed by <a href=\"spotify:album:2ODvWsOgouMbaA5xf0RkJe\" data-name=\"Starboy\">Starboy</a> at #2)."
