    "biography": "15x time GRAMMY Award winner Bruno Mars is one of the best-selling artists of all time. DOO-WOPS &amp; HOOLIGANS marked the landmark debut of a remarkable new artist. The album – which peaked at #3 on the Billboard 200 – has gone on to achieve global album equivalent sales of 15.5 million. Now boasting more than 7.8 billion total streams, DOO-WOPS &amp; HOOLIGANS is certified RIAA 6X platinum, the longest-charting debut album on Top 200 and #4 longest-running of all time. \nHis most recent album, the critically acclaimed, 3x platinum-certified 24K MAGIC, made an impressive debut atop Billboard’s “Top Digital Albums” and “Top R&amp;B/Hip-Hop Albums” charts upon its 2016 arrival. The album includes the 7x platinum-certified, #1 single, “That’s What I Like” – Mars’ seventh “Hot 100” chart-topper and first-ever #1 on the “Hot R&amp;B Songs” chart, affirming him as one of the few artists to have written and produced each of his #1 hits as well as to have a #1 song on the “Hot 100” from each of his first three studio albums. \nAmong his truly countless accolades, Mars is a 4x Guinness World Record holder, with his milestone 2015 NFL Super Bowl Halftime Show drawing a record-breaking total viewership of over 115.3 million. Mars also holds the world record as the “First Male Artist to Achieve Three 10 Million Selling Singles”, while 2016’s 2x GRAMMY® Award-winning, worldwide #1 collaboration with Mark Ronson, “Uptown Funk,” made history for the “Most Weeks at #1 on the U.S. Digital Song Sales” chart."
